const express = require("express");
const app = express();

app.get("/cors", (req, res) => {
	res.set("Access-Control-Allow-Origin", "*");
	res.send({ msg: "This has CORS enabled ðŸŽˆ" });
});

function App() {
	return (
		<BrowserRouter>
			<Nav />
			<YelpReviews />
			<HomePage />
			<div className="container">
				{/* <Routes><Route path="/" element={<HomePage />} /></Routes> */}
			</div>
			<Footer />
		</BrowserRouter>
	);
}

export default App;
